import React from "react";
import ReactDOM from "react-dom";
import "./index.css";
import App from "./App";
import reportWebVitals from "./reportWebVitals";

const routing = (
  <Router>
    <NavLink activeClassName="active" path="/projects" component={Projects}>
      <button class="btn">Enter Site</button>
    </NavLink>
  </Router>
);

ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById("root")
);

